Here is the final atbash-cipher.js implementation:

```js
function atbash(text) {
  return text
    .toLowerCase()
    .split("")
    .map(c => {
      if (c >= 'a' && c <= 'z') {
        const code = c.charCodeAt(0);
        const reverseCode = 122 - (code - 97);
        return String.fromCharCode(reverseCode);
      } else {
        return c;
      }
    })
    .join("");
}

function encode(plaintext) {
  const cleaned = plaintext.toLowerCase().replace(/[^a-z0-9]/g, '');
  const atbashText = atbash(cleaned);
  const groups = [];
  for (let i = 0; i < atbashText.length; i += 5) {
    groups.push(atbashText.slice(i, i + 5));
  }
  return groups.join(' ');
}

function decode(ciphertext) {
  const cleaned = ciphertext.toLowerCase().replace(/\s/g, '');
  return atbash(cleaned);
}

module.exports = { encode, decode };
